create table voli (
	cod_volo INT AUTO_INCREMENT,
	aereo INT,
	aeroporto_partenza INT,
	aeroporto_arrivo INT,
	data_partenza DATE,
	data_arrivo DATE,
	ora_partenza VARCHAR(50),
	ora_arrivo VARCHAR(50),
    PRIMARY KEY(cod_volo),
    FOREIGN KEY (aereo) REFERENCES Aerei(numero_registrazione),
    FOREIGN KEY (aeroporto_partenza) REFERENCES Aeroporti(cod_aeroporto),
    FOREIGN KEY (aeroporto_arrivo) REFERENCES Aeroporti(cod_aeroporto)
);
